import React from "react";
import "../styles/app.css";
import Header from "./Header";
import Main from "./Main";
import { BrowserRouter } from "react-router-dom";

function App() {
    return (
        <BrowserRouter>
            <div className="app">
                <Header></Header>
                <Main></Main>
            </div>
        </BrowserRouter>
    );
}

export default App;
